import React, { Component } from "react";

export class CreateBoard extends Component {
	render() {
		return (
			<div className=" bg-gray-300 h-20 w-1/5 inline-block cursor-pointer p-3  m-1 flex items-center justify-center text-gray-400">
				<p onClick = {this.update}>create new board</p>
			</div>
		);
	}
}

export default CreateBoard;
